const API_KEY = '506e716ab594396861cd8e374cf41d89';
export const getData = async (search, page) => {
    let data = [];
    const url = `https://www.flickr.com/services/rest/?method=flickr.photos.search&per_page=25&api_key=92238c1308cfdba1d617e6a61895d886&text=${search}&page=${page}&format=json&nojsoncallback=1`;
    await fetch(url)
        .then((response) => response.json())
        .then(value => {
            if ('photos' in value) {
                data = value.photos.photo;
            }
        })
    return data;
}
